var data = str.split(' ');

var cards = [];
var jokers = 0;

data.forEach(function(item){
  item = item*1;
  if(item == 0){
    jokers++;
  } else {
    cards.push(item);
  }
});

if(cards.length>0){
  cards = merge_sort(cards);
}

var bestSeq = 0;
var usedJokers = 0;
var currSeq = 0;

if( cards.length > 0 ) {

  currSeq = 1;
  var currCard = cards[0];

  var lastI;
  for(var i=1; i<cards.length; i++){
    // console.log(i, currCard, cards[i], currSeq, usedJokers)
    if( currCard == cards[i] ){
      //DO NOTHING;
      currCard = cards[i];
    } 
    else if( cards[i] == currCard + 1 ){
      currSeq++;
      currCard = cards[i];
    }
    else if( usedJokers < jokers ){
      currSeq++;
      if( usedJokers == 0 ){
        lastI = i;
      }
      usedJokers++;
      currCard = currCard+1;
      i = i-1;
    }
    else{
      if( currSeq > bestSeq )
        bestSeq = currSeq;
      currSeq = 1;
      usedJokers = 0;
      i = lastI || i;
      currCard = cards[i];
    }
  }
}

if( currSeq > bestSeq )
  bestSeq = currSeq;
if( currSeq == bestSeq && usedJokers < jokers )
  bestSeq += (jokers - usedJokers)


